# PMC TUI Working Package - Self-Extracting Installer
# Created: December 10, 2024
# Contains: Fixed loader system with manual loading + Enter/Space input fixes

<#
.SYNOPSIS
Self-extracting package for PMC TUI working directory

.DESCRIPTION
This script extracts the PMC TUI working directory with all fixes:
- Manual loading system (no ClassLoader dependency issues)
- EnhancedRenderEngine removed (OptimizedRenderEngine has z-index)
- InlineEditor Enter/Space key fixes
- TabbedScreen input routing fixes
- StandardListScreen key consumption fixes

.PARAMETER TargetPath
Where to extract the package (default: ./pmc-working-extracted)

.EXAMPLE
.\pmc-working-package.ps1
.\pmc-working-package.ps1 -TargetPath C:\PMC\working
#>

param(
    [string]$TargetPath = "pmc-working-extracted"
)

Write-Host "PMC TUI Working Package - Self-Extracting Installer" -ForegroundColor Cyan
Write-Host "====================================================`n" -ForegroundColor Cyan

# Create target directory
if (Test-Path $TargetPath) {
    Write-Host "Warning: Target path '$TargetPath' already exists." -ForegroundColor Yellow
    $response = Read-Host "Overwrite? (y/n)"
    if ($response -ne 'y') {
        Write-Host "Extraction cancelled." -ForegroundColor Red
        exit 1
    }
    Remove-Item -Recurse -Force $TargetPath
}

Write-Host "Creating directory: $TargetPath" -ForegroundColor Green
New-Item -ItemType Directory -Path $TargetPath -Force | Out-Null

# Extract base64 data to temp file
$tempZip = Join-Path $env:TEMP "pmc-working-temp.zip"
