try {
    # Decode base64 to ZIP file
    $bytes = [System.Convert]::FromBase64String($base64Data)
    [System.IO.File]::WriteAllBytes($tempZip, $bytes)
    
    Write-Host "Expanding archive to $TargetPath..." -ForegroundColor Green
    Expand-Archive -Path $tempZip -DestinationPath $TargetPath -Force
    
    # Cleanup
    Remove-Item $tempZip -Force
    
    Write-Host "`nPackage extracted successfully!" -ForegroundColor Green
    Write-Host "Location: $TargetPath" -ForegroundColor Cyan
    Write-Host "`nNext steps:" -ForegroundColor Yellow
    Write-Host "  1. cd $TargetPath" -ForegroundColor White
    Write-Host "  2. Import-Module module/Pmc.Strict/Pmc.Strict.psd1" -ForegroundColor White
    Write-Host "  3. Start-PmcTUI" -ForegroundColor White
    
} catch {
    Write-Host "Error extracting package: $_" -ForegroundColor Red
    if (Test-Path $tempZip) {
        Remove-Item $tempZip -Force
    }
    exit 1
}
